import React,{useEffect,useState} from 'react';
import Layout from '../../Components/Layout/Layout'
import { Container } from 'react-bootstrap'
import { Table } from 'react-bootstrap'
import axios from '../../helpers/axios';


const Result = (props) => {
    const userId = props.match.params.userId;
    const [results, setResults] = useState([]);
    const [error, setError] = useState("");

    useEffect(async () => {
        try {
            const res = await axios.get(`/get/all/results/${userId}`);
            setResults(res.data.result);
        } catch (err) {
            setError("Something wrong!");
        }
    }, []);
    return (
        <Layout>
            <div className="mainDiv">
                <Container>
                    <h1>Your all result history : </h1>
                    <div style={{marginTop:'30px'}}>
                        <Table responsive="md">
                            <thead>
                                <tr>
                                    <th>#</th>
                                    <th>Model Name</th>
                                    <th>Course Name</th>
                                    <th>Unit Name</th>
                                    <th>Number of attempts</th>
                                    <th>Score</th>
                                </tr>
                            </thead>
                            <tbody>
                                <tr>
                                    <td>1</td>
                                    <td>Table cell</td>
                                    <td>Table cell</td>
                                    <td>Table cell</td>
                                    <td>Table cell</td>
                                    <td>Table cell</td>
                                    <td>Table cell</td>
                                </tr>
                                <tr>
                                    <td>2</td>
                                    <td>Table cell</td>
                                    <td>Table cell</td>
                                    <td>Table cell</td>
                                    <td>Table cell</td>
                                    <td>Table cell</td>
                                    <td>Table cell</td>
                                </tr>
                                <tr>
                                    <td>3</td>
                                    <td>Table cell</td>
                                    <td>Table cell</td>
                                    <td>Table cell</td>
                                    <td>Table cell</td>
                                    <td>Table cell</td>
                                    <td>Table cell</td>
                                </tr>
                            </tbody>
                        </Table>
                        </div>

                </Container>
            </div>
        </Layout>
            );
};

            export default Result;
